    <div className="supp480:h-[2000px] supp1024:h-[1800px]  h-[1400px] w-screen bg-orangeMarron flex items-end justify-center transform translate-x-[-5px]">
        <div className="supp860:w-[800px] supp1600:w-[1300px] w-[90%]  border-[3px] border-bleuGris h-[95%] rounded-[30px] ">
            <IntroWork/>
            <ContenuWork/>
